import React, { useState, useEffect } from 'react';
import axios from 'axios';

interface FutureCreationDTO {
  symbol: string;
  description: string;
  isin: string;
  expirationCode: string;
  parentTicker: string;
  fullName: string;
  segment: string;
  maturityDate: string;
  firstTradingDate: string;
  lastTraadingDate: string;
  initialMarginAmount: number;
  percentageMargin: number;
  lotSize: number;
  contractMultiplier: number;
  tradingCurrency: string;
  underlyingType: string;
  underlyingId: number;
  settlementMethod: string;
  instrumentStatus: boolean;
  tickSize: number;
  tickValue: number;
  depositType: string;
}

const FutureCreationForm: React.FC = () => {
  const [form, setForm] = useState<FutureCreationDTO>({
    symbol: '',
    description: '',
    isin: '',
    expirationCode: '',
    parentTicker: '',
    fullName: '',
    segment: '',
    maturityDate: '',
    firstTradingDate: '',
    lastTraadingDate: '',
    initialMarginAmount: 0,
    percentageMargin: 0,
    lotSize: 0,
    contractMultiplier: 0,
    tradingCurrency: '',
    underlyingType: '',
    underlyingId: 0,
    settlementMethod: '',
    instrumentStatus: false,
    tickSize: 0,
    tickValue: 0,
    depositType: '',
  });

  const [settlementMethods, setSettlementMethods] = useState<string[]>([]);
  const [depositTypes, setDepositTypes] = useState<string[]>([]);
  const [underlyingTypes, setUnderlyingTypes] = useState<string[]>([]);
  const [underlyingAssets, setUnderlyingAssets] = useState<{ id: number; identifier: string }[]>([]);

  useEffect(() => {
    async function fetchEnums() {
      const [settlementRes, depositRes, typeRes] = await Promise.all([
        axios.get<string[]>('/api/enums/settlement-methods'),
        axios.get<string[]>('/api/enums/deposit-types'),
        axios.get<string[]>('/api/underlyings/types'),
      ]);
      setSettlementMethods(settlementRes.data);
      setDepositTypes(depositRes.data);
      setUnderlyingTypes(typeRes.data);
    }
    fetchEnums();
  }, []);

  useEffect(() => {
    if (form.underlyingType) {
      axios.get<{ id: number; identifier: string }[]>(`/api/underlying-assets?type=${form.underlyingType}`)
        .then(res => setUnderlyingAssets(res.data))
        .catch(() => setUnderlyingAssets([]));
      setForm(prev => ({ ...prev, underlyingId: 0 }));
    } else {
      setUnderlyingAssets([]);
      setForm(prev => ({ ...prev, underlyingId: 0 }));
    }
  }, [form.underlyingType]);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value, type, checked } = e.target;
    setForm(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      await axios.post('/api/futures', form);
      alert('Future créé avec succès');
    } catch (err) {
      alert('Erreur lors de la création');
      console.error(err);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input name="symbol" value={form.symbol} onChange={handleChange} placeholder="Symbol" required />
      <input name="description" value={form.description} onChange={handleChange} placeholder="Description" />
      <input name="isin" value={form.isin} onChange={handleChange} placeholder="ISIN" />
      <input name="expirationCode" value={form.expirationCode} onChange={handleChange} placeholder="Expiration Code" />
      <input name="parentTicker" value={form.parentTicker} onChange={handleChange} placeholder="Parent Ticker" />
      <input name="fullName" value={form.fullName} onChange={handleChange} placeholder="Full Name" />
      <input name="segment" value={form.segment} onChange={handleChange} placeholder="Segment" />
      <input type="date" name="maturityDate" value={form.maturityDate} onChange={handleChange} />
      <input type="date" name="firstTradingDate" value={form.firstTradingDate} onChange={handleChange} />
      <input type="date" name="lastTraadingDate" value={form.lastTraadingDate} onChange={handleChange} />
      <input type="number" name="initialMarginAmount" value={form.initialMarginAmount} onChange={handleChange} placeholder="Initial Margin Amount" />
      <input type="number" name="percentageMargin" value={form.percentageMargin} onChange={handleChange} placeholder="Percentage Margin" />
      <input type="number" name="lotSize" value={form.lotSize} onChange={handleChange} placeholder="Lot Size" />
      <input type="number" name="contractMultiplier" value={form.contractMultiplier} onChange={handleChange} placeholder="Contract Multiplier" />
      <input name="tradingCurrency" value={form.tradingCurrency} onChange={handleChange} placeholder="Trading Currency" />

      <select name="underlyingType" value={form.underlyingType} onChange={handleChange} required>
        <option value="">Sélectionnez Type Sous-Jacent</option>
        {underlyingTypes.map(type => (
          <option key={type} value={type}>{type}</option>
        ))}
      </select>

      <select name="underlyingId" value={form.underlyingId} onChange={handleChange} required disabled={!form.underlyingType}>
        <option value={0}>Sélectionnez Sous-Jacent</option>
        {underlyingAssets.map(asset => (
          <option key={asset.id} value={asset.id}>{asset.identifier}</option>
        ))}
      </select>

      <select name="settlementMethod" value={form.settlementMethod} onChange={handleChange} required>
        <option value="">Settlement Method</option>
        {settlementMethods.map(method => (
          <option key={method} value={method}>{method}</option>
        ))}
      </select>

      <input type="checkbox" name="instrumentStatus" checked={form.instrumentStatus} onChange={handleChange} /> Instrument Actif

      <input type="number" step="0.01" name="tickSize" value={form.tickSize} onChange={handleChange} placeholder="Tick Size" />
      <input type="number" step="0.01" name="tickValue" value={form.tickValue} onChange={handleChange} placeholder="Tick Value" />

      <select name="depositType" value={form.depositType} onChange={handleChange} required>
        <option value="">Deposit Type</option>
        {depositTypes.map(type => (
          <option key={type} value={type}>{type}</option>
        ))}
      </select>

      <button type="submit">Créer Future</button>
    </form>
  );
};

export default FutureCreationForm;
